import React, { useEffect, useState } from "react";
import { Card, Image, List, Header, Icon, Label, Menu, Table, Pagination} from "semantic-ui-react";
import axios from 'axios';

export const ViewItemPriceHistory = ({ item_name }) => {
  const [priceHistory, setPriceHistory] = useState([]);

  useEffect(() => {
    axios
    .get("/view_item_price_history", {
      params: {
        item_name,
      },
    })
    .then(({ data }) => {
      setPriceHistory(data.price_history);
    })
  }, []);

  return (
    <Table celled>
      <Table.Header>
        <Table.Row>
          <Table.HeaderCell>Date</Table.HeaderCell>
          <Table.HeaderCell>Price</Table.HeaderCell>
          <Table.HeaderCell>Volume</Table.HeaderCell>
        </Table.Row>
      </Table.Header>

      <Table.Body>
        {priceHistory.map(priceHistoryPoint => {
          console.log(priceHistoryPoint)
          return (
            <Table.Row>
              <Table.Cell>{priceHistoryPoint.price_history_point_date}</Table.Cell>
              <Table.Cell>{priceHistoryPoint.price_history_point_price}</Table.Cell>
              <Table.Cell>{priceHistoryPoint.price_history_point_volume}</Table.Cell>
            </Table.Row>
          )
        })}
      </Table.Body>
    </Table>
  );
};

export default ViewItemPriceHistory;
